import React, { Component } from 'react';
import Approved from '../assets/svg/approved.svg'; 

class FormHead extends Component {

    render() {
    const {thankYouText} = this.props;
    const moreCount = ['','','']
        return (
            <div className='approved-heading'>
                <img
                className='approved-logo-icon'
                alt='Approved logo icon'
                draggable="false"
                src={Approved}
                />
                <p className='approved-text'>{thankYouText}</p>
                <div className='approved-more-section'>
                </div>
            </div>
        )
    }
  }
  
  export default FormHead;
